INSERT INTO `cms_content_element` VALUES (14216,1,1,1474011027,1488319294,1474011027,NULL,500,'Y','Слайд 1',17693,NULL,'slayd-1','','',4,NULL,NULL,NULL,'','','','text','text',NULL),(14995,1,1,1481720363,1488319370,1481720363,NULL,500,'Y','Слайд 2',17695,NULL,'slayd-2','','',4,NULL,NULL,NULL,'','','','text','text',NULL),(14999,1,1,1488317969,1488318009,1488317969,NULL,500,'Y','Полесье',17689,NULL,'polese','','',9,70,NULL,NULL,'','','','text','text',NULL),(15001,1,1,1488318169,1488318176,1488318169,NULL,500,'Y','Toy State',17692,NULL,'toy-state','','',9,70,NULL,NULL,'','','','text','text',NULL),(15002,NULL,NULL,1497991317,1497991318,1497991317,NULL,500,'Y','Мягкая игрушка FurReal Friends \"Поющие зверята\" ',17696,NULL,'myagkaya-igrushka-furreal-friends-poyuschie-zveryata',NULL,'<p>Мягкая игрушка FurReal Friends \"Поющие зверята\" от бренда Hasbro порадует малышку и приведет ее в восторг. Небольшая мягкая игрушка сшита из мягчайшего плюша. Глазки зверушки сделаны из пластика высокого качества и выглядят очень реалистично. Зверушка смотрит так, будто призывает ребенка поиграть с ней.</p>\r\n<p>Игрушка реагирует на прикосновения, так как внутри нее встроены сенсорные датчики. Также зверек может поворачивать голову. Удивительной, замечательной особенностью игрушки является ее способность воспроизводить веселые песенки, развлекая малышку. Эта милая мягкая игрушка не останется без внимания у ребенка.</p>\r\n<p><strong>Внимание!</strong> Товар представлен в ассортименте. Номер желаемой игрушки указывайте в комментарии к заказу. Стоимость указана за 1 игрушку.</p>',2,9,NULL,NULL,'','','','text','text',NULL),(15003,NULL,NULL,1497991323,1497991324,1497991323,NULL,500,'Y','Щенок FurReal Friends \"Поющие зверята\"',17705,NULL,'schenok-furreal-friends-poyuschie-zveryata',NULL,'<p style=\"text-align: justify;\">Интерактивный щенок из серии &quot;Поющие зверята&quot; FurReal Friends (Фуриал Френдс) от торговой марки Hasbro без сомнений покорит любого, кто услышит его неповторимое пение! Эта интерактивная игрушка входит в линейку Luvimals (Поющие зверята), а это значит, что ее главной особенностью является умение исполнять веселую песенку.</p>\r\n\r\n<p style=\"text-align: justify;\">Щенок FurReal Friends выглядит очень мило благодаря длинным ушкам и добрым глазкам, цвет которых отлично дополняет фирменный медальон с логотипом серии. Игрушка изготовлена из приятного на ощупь материла коричневого цвета, а под ним тщательно скрыт хитрый механизм, благодаря которому этот очаровательный песик умеет петь. Для того, чтобы щенок запел, необходимо нажать на кнопочку, расположенную у него на спинке.</p>\r\n\r\n<p style=\"text-align: justify;\">Щенок выполнен в небольшом размере, благодаря чему его можно брать с собой куда угодно. Кроме того, у всех игрушечных питомцев из серии &quot;Поющие зверята&quot; есть одна способность: они&nbsp;умеют петь хором, чем несомненно смогут поднять настроение своим маленьким хозяевам.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного&nbsp;щенка из серии &quot;Поющие зверята&quot; FurReal Friends (Фуриал Френдс) от Hasbro&nbsp;в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интерактивный щенок Поющие зверята FurReal Friends (Фуриал Френдс) C2176 C2173 Hasbro ','Купить интерактивного щенка из серии \"Поющие зверята\" FurReal Friends (Фуриал Френдс) от Hasbro в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!','furreal friends поющие зверята щенок интерактивная игрушка питомец песик собачка фуриал френдс luvimals купить в интернет магазине','text','text',NULL),(15004,NULL,NULL,1497991324,1497991325,1497991324,NULL,500,'Y','Забавный котенок Ками, друг Пакса',17707,NULL,'zabavnyiy-kotenok-kami-drug-paksa',NULL,'<p style=\"text-align: justify;\">Веселый котенок Ками FurReal Friends (Фуриал Френдс)&nbsp;от торговой марки Hasbro - это&nbsp;интерактивный питомец, который несомненно станет самым лучшим другом для своего обладателя. Котенок выглядит совсем как настоящий, а еще он любит ласку и заботу, а также весело проводить время со своим хозяином.</p>\r\n\r\n<p style=\"text-align: justify;\">Забавный друг щенка Пакса Kami&nbsp;скрывает внутри себя хитрый механизм, благодаря которому котенок может двигаться и издавать разные&nbsp;звуки. Он&nbsp;имеет приятную на ощупь шерстку и симпатичный окрас породы Сиамских кошек. В комплекте к игрушке также есть пластиковый поводок, который легко можно изменить в размере, от длинного до короткого.</p>\r\n\r\n<p style=\"text-align: justify;\">Во время прогулки Kami FurReal Friends может ходить и садиться совсем как настоящий котенок. Когда ребенок выгуливает своего игрушечного питомца, то котенок Ками делает правдоподобные движения, создавая ощущение что он идет.</p>\r\n\r\n<p style=\"text-align: justify;\">У котенка забавная внешность, благодаря чему он выглядит еще милее. Ками имеет бежевый окрас, а его хвостик, лапки и ушки светло-коричневого цвета. Мордочка котика Kami также дополнена коричневым цветом, а пластиковые глаза питомца окрашены в голубой, делая образ игрушки еще более привлекательным.</p>\r\n\r\n<p style=\"text-align: justify;\">У котенка Ками &quot;Фуриал Френдс&quot; есть очень интересная функция, которая заключается в том, что зверька можно кормить несмотря на то, что он игрушечный. В комплекте для этого есть специальные пластиковые наггетсы. Помещая их один за другим в рот питомца, можно услышать как он их проглатывает. Во время прогулки с котенком может наступить момент, когда Kami необходимо сделать свои кошачьи дела. Для этого нужно потянуть за поводок, чтобы веселый котенок Kami присел, после чего под ним окажутся съеденные наггетсы. Убрать за питомцем можно при помощи специального пакетика, который также входит в комплект.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного веселого котенка Ками FurReal Friends / Фуриал Френдс от Hasbro можно в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Забавный котенок Ками друг Пакса FurReal Friends C1156 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивного забавного котенка Ками, друга Пакса FurReal Friends / Фуриал Френдс от Hasbro в интернет-магазине FurReal.ru недорого!','забавный котенок ками друг пакса kami furreal friends фуриал френдс хасбро hasbro c1156 интерактивная игрушка котик веселый  купить в интернет магазине россия ','text','text',NULL),(15005,NULL,NULL,1497991331,1497991332,1497991331,NULL,500,'Y','Поросенок FurReal Friends \"Забавные зверята\"',17721,NULL,'porosenok-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/HYh4Gtl6Egg\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Эта&nbsp;очаровательная свинка&nbsp;FurReal Friends (Фуриал Френдс)&nbsp;относится к серии &quot;Забавные зверята&quot; от Hasbro. Поросенок&nbsp;изображен в сидячей позе и выглядит очень трогательно. Его мягкие розовенькие ушки и большие голубые глаза способны растопить любое сердце. Ну разве такого крошку не хочется взять на ручки, приласкать, покормить и убаюкать? Интерактивная игрушка-поросенок FurReal Friends создана как раз для этого!</p>\r\n\r\n<p style=\"text-align: justify;\">Вся серия мягких питомцев &quot;Забавные зверята Фуриал Френдс&quot; создана с наличием у игрушек какого-либо особенного умения. Поросенок FurReal Friends умеет пить из своего стаканчика с трубочкой, который входит в комплект. Еще он может сонно закрывать глазки, что выглядит крайне забавно. Вообще у поросенка целая палитра веселых и прикольных звуков, которые нравятся детям и веселят всех окружающих. Поросенка приятно держать на руках, с ним можно придумывать множество сюжетно-ролевых игр.</p>\r\n\r\n<p style=\"text-align: justify;\">На ощупь тельце мягкого интерактивного питомца Фуриал Френдс очень приятное. Поросенок забавно сидит и протягивает вперед свои лапки. При нажатии на игрушку лапки двигаются. Игрушка хороша тем, что она на первый взгляд ни чем не отличается от обычной мягкой зверушки, имеет небольшой вес и размер. Но интерактивные эффекты делают такого поросенка необычным и интересным.</p>\r\n\r\n<p style=\"text-align: justify;\">Механизм внутри игрушки сделан очень прочно и надежно защищен, чтобы не помешать игре ребенка. Купить свинку&nbsp;FurReal Freinds Lil Big Paws &quot;Забавные зверята&quot;&nbsp;от Hasbro&nbsp;по самой дешевой цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Поросенок забавные зверята FurReal Friends B4989 A9084 Hasbro Lil Big Paws купить в интернет-магазине FurReal.ru','Купить поросенка забавные FurReal Friends от Hasbro дешево по самой низкой цене в фирменном интернет-магазине FurReal.ru!','свинка furreal friends забавные зверята поросенок интерактивная игрушка купить пушистые друзья patootie piggy lil big paws фуриал френдс смешные зверушки ','text','text',NULL),(15006,NULL,NULL,1498025961,1498025962,1498025961,NULL,500,'Y','Мой игривый енот FurReal Friends Woodland Sparkle',17723,NULL,'moy-igrivyiy-enot-furreal-friends-woodland-sparkle',NULL,'<p style=\"text-align: justify;\">Мой игривый енот FurReal Friends&nbsp;(Фуриал Френдс)&nbsp;от Hasbro представляет собой очаровательного игрушечного зверька, общение с которым придется по душе любому ребенку. Енот FurReal Friends по имени Rocco входит в серию Woodland Sparkle - игрушки, входящие в нее, отличаются необычайным блеском и по-настоящему сверкают. Помимо этого у игрушки &ldquo;Мой игривый енот Фуриал Френдс&rdquo; есть интересные функции - он может играть с ребенком в прятки, издавая при этом забавные звуки и шевеля лапками.</p>\r\n\r\n<p style=\"text-align: justify;\">Питомец-енот &ldquo;Фуриал Френдс&rdquo; покрыт серой блестящей шерсткой. Его пластиковые зеленые глазки изнутри заполнены глиттером, внутренняя часть ушек тоже сверкает. Внешний вид зверька очень узнаваем - у него есть и темная &ldquo;масочка&rdquo; на морде, и длинный полосатый хвост. Нажимая на пузико игрушки, ребенок сможет увидеть, как енот поднимает лапки и закрывает глаза, приглашая поиграть в прятки. Размер игрушки &ldquo;Мой игривый енот FurReal Friends достаточно компактный, поэтому енота удобно держать в руках. Енотик изображен в стоячем на задних лапах положении, передние лапки двигаются при нажатии на кнопку. Также питомец издает очаровательные звуки.</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивный енот FurReal Friends - отличный выбор для тех, кто ищет необычную и милую игрушку для ребенка, отличную от классических щенков и котят. Еноты сейчас необычайно популярны, и многие дети мечтали бы завести себе такого зверька в качестве домашнего любимца. Игрушка &ldquo;Мой игривый енот&rdquo; от &quot;Хасбро&quot;&nbsp;поможет осуществить это желание!</p>\r\n\r\n<p style=\"text-align: justify;\">Купить игривого&nbsp;енота FurReal Friends Woodland Sparkle&nbsp;от Hasbro в интернет-магазине FurReal.ru вы можете по самой низкой&nbsp;цене с доставкой по всей России!</p>\r\n',2,9,NULL,NULL,'Мой игривый енот FurReal Friends Woodland Sparkle B2969 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку “Мой игривый енот FurReal Friends Woodland Sparkle” от Hasbro в интернет-магазине FurReal.ru вы можете по самой низкой цене!','мой игривый енот furreal friends woodland sparkle rocco hasbro купить интерактивная игрушка фуриал френдс енот peek-a-boo raccoon','text','text',NULL),(15007,NULL,NULL,1498025962,1498025963,1498025962,NULL,500,'Y','Мой первый снежный барс FurReal Friends - Flurry',17725,NULL,'moy-pervyiy-snejnyiy-bars-furreal-friends-flurry',NULL,'<p style=\"text-align: justify;\">Интерактивный питомец &ldquo;Мой первый снежный барс&quot; FurReal Friends (Фуриал Френдс)&nbsp;от Hasbro&nbsp;носит имя Flurry (Фларри) и является отличным выбором для ребенка. Ведь снежный барс &ldquo;Фуриал Френдс&rdquo; не только выглядит очень экзотично и необычно, но еще и наделен интереснейшими функциями. Звуковое сопровождение игрушки насчитывает более 45 разных реакций - и мяуканье, и довольное порыкивание, и другие забавные звуки.</p>\r\n\r\n<p style=\"text-align: justify;\">В комплект вместе с игрушкой &ldquo;Мой первый снежный барс Фуриал Френдс&rdquo; входит пара функциональных игровых аксессуаров. Погремушка в виде рыбки привлечет внимание снежного леопарда Flurry - электронный питомец будет идти на его звук. На кормление из соски-бутылочки снежный барс FurReal Friends реагирует соответствующими звуками.</p>\r\n\r\n<p style=\"text-align: justify;\">Всего у игрушки &ldquo;Мой первый снежный барс FurReal Friends&rdquo; насчитывается 3 сенсора, которые реагируют на взаимодействие с ребенком. Помимо ходьбы, снежный барс может вставать на задние лапки, крутить головой. Спектр его движений и действий достаточно широкий для того, чтобы милый маленький зверь стал любимцем ребенка на долгое время. Компания-производитель Hasbro позаботилась и о качестве игрушки. Механизм работает плавно и без лишних звуков, он вместе с блоком для элементов питания надежно скрыт под пушистой шкуркой леопарда Флурри, сделанной из искусственного меха.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить моего&nbsp;первого&nbsp;снежного&nbsp;барса&nbsp;FurReal Friends Flurry&nbsp;от Hasbro в интернет-магазине FurReal.ru вы можете по самой выгодной цене с доставкой по всей России!</p>\r\n',2,9,NULL,NULL,'Мой первый снежный барс FurReal Friends B2953 Hasbro купить в интернет-магазине FurReal.ru','Купить моего первого снежного барса FurReal Friends Flurry от Hasbro в интернет-магазине FurReal.ru по самой низкой цене с доставкой по Москве, СПб и во все регионы России!!','мой первый снежный барс furreal friends купить интерактивная игрушка питомец hasbro flurry snow leopard снежный леопард фуриал френдс фларри флурри флари флури','text','text',NULL),(15008,NULL,NULL,1498025964,1498025964,1498025964,NULL,500,'Y','Мой малыш медвежонок FurReal Friends Woodland Sparkle ',17727,NULL,'moy-malyish-medvejonok-furreal-friends-woodland-sparkle',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/bAb0oaPFg_M\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивная игрушка &ldquo;Мой малыш медвежонок&quot; FurReal Friends (Фуриал Френдс)&nbsp;от Hasbro - это милый питомец для ребенка, который порадует своими функциями, своим милым внешним видом и высоким качеством исполнения. Серия Woodland Sparkle от &ldquo;Фуриал Френдс&rdquo; удивляет тем, что питомцы в ней представлены сказочно блестящими, сверкающими. И этот малыш медвежонок&nbsp;не стал исключением - его шерстка искрится, подушечки лап переливаются, глаза и носик блестят, на его голове есть яркое&nbsp;украшение в виде венка из розовых цветочков.</p>\r\n\r\n<p style=\"text-align: justify;\">Повинуясь взаимодействию с ребенком, интерактивный медвежонок FurReal Friends Woodland Sparkle Peanut Butter может ходить, поворачивать голову, издавать забавные звуки и взаимодействовать с прилагающимися к нему аксессуарами. Они представлены забавной соской-бутылочкой и очаровательной игрушкой-погремушкой, которая украшена медвежьей мордашкой. Милый маленький мишка &ldquo;Фуриал Френдс&rdquo; реагирует на игрушку и может &ldquo;пить&rdquo;, издавая забавные звуки, когда соска оказывается у него во рту.</p>\r\n\r\n<p style=\"text-align: justify;\">Мой малыш медвежонок FurReal Friends обладает компактным размером - его приятно держать на руках и гладить, смотря при этом в чарующие блестящие глазки. Его можно взять с собой на прогулку. Переживать насчет ломкости игрушки не стоит - как и все интерактивные питомцы Hasbro &ldquo;Фуриал Френдс&rdquo; этот сделан на славу. Его надежный механизм хорошо спрятан под приятной на ощупь рыже-коричневой искусственной шерстью, и он совершенно не мешает ребенку во время игры.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивную игрушку &ldquo;Мой малыш медвежонок&quot; FurReal Friends Woodland Sparkle&nbsp;от Hasbro в интернет-магазине FurReal.ru вы можете по самой низкой&nbsp;цене!</p>\r\n',2,9,NULL,NULL,'Мой малыш медвежонок FurReal Friends Woodland Sparkle B2966 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку \"Мой малыш медвежонок\" FurReal Friends Woodland Sparkle от Hasbro в интернет-магазине FurReal.ru по самой низкой цене с доставкой по всей России!','мой малыш медвежонок furreal friends woodland sparkle peanut butter hasbro купить интерактивная игрушка фуриал френдс мишка медведь маленький','text','text',NULL),(15009,NULL,NULL,1498025965,1498025966,1498025965,NULL,500,'Y','Бисквит Furreal Friends \"Ходячие зверята\"',17729,NULL,'biskvit-furreal-friends-hodyachie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/aqujiDfgegU\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Щенок Бисквит FurReal Friends (Фуриал Френдс)&nbsp;от Hasbro - это собака-робот породы золотистый ретривер из серии &ldquo;Ходячие зверята&rdquo;. Щеночек имеет достаточно реалистичный внешний вид и увлекательные функции. Бисквит &ldquo;Фуриал Френдс&rdquo; - это имя, которым производитель Hasbro наградил питомца, однако счастливый обладатель этой игрушки сможет проявить свою фантазию и назвать собачку по-своему.</p>\r\n\r\n<p style=\"text-align: justify;\">Словно у настоящего щенка золотистого ретривера, у игрушки-собаки шерстка приятного бежевого цвета. Верхнее покрытие интерактивной собачки FurReal Friends представлено искусственным мехом. У песика красивые блестящие глазки, которые выглядят почти как живые. Его среднего размера ушки и небольшой хвостик отражают стандарты породы &ldquo;золотистый ретривер&rdquo;, а умилительно выглядящий язычок и блестящий носик заставят вас улыбнуться.</p>\r\n\r\n<p style=\"text-align: justify;\">Собака Бисквит FurReal Friends умеет правдоподобно передвигаться, т.к. эта игрушка относи