ные зверята\"',17761,NULL,'schenok-printsessa-furreal-friends-modnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/jyaX6xZnD8g\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Модный Щенок&nbsp;FurReal Friends (Фуриал Френдс) от Hasbro&mdash; это очаровательный питомец для самых стильных и изысканных девочек. Игрушка относится к серии &quot;Фуриал Френдс&quot; под названием Pets with Style - &quot;Модные зверята&quot; от Hasbro. Эта маленькая собачка позволит не только ухаживать за ней в игре, но и всячески украшать ее и создавать ей стильный образ. Щенок-принцесса комплектуется различными аксессуарами и имеет очень аристократичный и кокетливый внешний вид. Особенную изюминку щеночку придают большие голубые глазки с очень длинными и пушистыми ресничками.</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивная игрушка &quot;Щенок-принцесса Фуриал Френдс&quot; оснащена звуковыми эффектами. Чтобы щенок звонко залаял, достаточно лишь нажать ему на спинку. В комплекте с собачкой-принцессой имеется розовая тиара, самоцветы для ее украшения, и еще целый набор небольших наклеек. Особое внимание при игре с этой интерактивной зверушкой стоит уделить ее прическе. У собаки очень длинные ушки, созданные из искусственных волос высокого качества. Поворачивая небольшой бантик на голове питомца, можно регулировать длину &quot;волос&quot; собачки. Для ухода за ними в комплекте имеется удобная расчесочка, а после расчесывания ушки можно будет украсить заколками. Как завершение образа, на шее игрушки есть еще и фирменный медальончик &quot;Фуриал Френдс&quot;, выполненный в форме сердца.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного модного&nbsp;щенка &quot;Модные зверята&quot;&nbsp;FurReal Friends / Фуриал Френдс от Хасбро дешево&nbsp;по самой низкой&nbsp;цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Модный щенок модные зверята FurReal Friends A9934 A9085 Hasbro купить в интернет-магазин FurReal.ru','Купить модного щенка FurReal Friends \"Модные зверята\" от Hasbro по самой выгодной цене в интернет-магазине FurReal.ru с доставкой по всей России!','щенок принцесса furreal friends модные зверята купить фуриал френдс интерактивная мягкая игрушка собачка pets with style princess бело-коричневая','text','text',NULL),(15014,NULL,NULL,1498025988,1498025989,1498025988,NULL,500,'Y','Щенок-принцесса Furreal Friends \"Модные зверята\"',17771,NULL,'schenok-printsessa-furreal-friends-modnyie-zveryata-15013',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/jyaX6xZnD8g\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Белый щенок&nbsp;&quot; Модные зверята&quot; FurReal Friends&nbsp;(Фуриал Френдс)&nbsp;от Hasbro &mdash; это питомец для юных королевских особ и истинных модниц. Собачка из серии &quot;Фуриал Френдс: Pets with Style&quot; поразит своим изысканным внешним видом, а также стильными аксессуарами, которые имеются в комплекте. Щеночек имеет белоснежно-белую шерстку, что как нельзя лучше подчеркивает аристократический статус питомца.</p>\r\n\r\n<p style=\"text-align: justify;\">Модная собачка FurReal Friends комплектуется изящными украшениями и даже предметом гардероба. Это юбочка, которая не просто красивая, но еще и волшебным образом может менять свой цвет. Для того чтобы изменить расцветку магической юбочки принцессы, можно использовать водный маркер, стилизованный под золотой царский скипетр. При намокании мелкие рисунки на розовой юбочке из белых превращаются в переливающиеся всеми цветами радуги. Через некоторое время эффект пропадает, и волшебство можно творить снова!</p>\r\n\r\n<p style=\"text-align: justify;\">Голову красавицы-собачки FurReal Friends украшает золотистая тиара. На нее можно крепить дополнительные элементы в виде искусственных самоцветов, чтобы сделать этот аксессуар еще роскошнее. Другое не менее любопытное украшение этой мягкой интерактивной игрушки &mdash; гламурный розовый ошейник. Он может быть надет либо игрушке на шею, либо хозяйка сможет воспользоваться им сама, ведь он легко превращается в столь же гламурный браслет на руку!</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивная игрушка из серии &quot;Модные зверята&nbsp;FurReal Friends&quot; может звонко лаять, как настоящая собачка. Для этого нужно всего лишь нажать ей на спинку. У нее очень милый внешний вид &mdash; чего стоят только одни глазки, обрамленные очень длинными завитыми ресницами.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить белого щенка&nbsp;&quot;Модные зверята&quot; FurReal Friends /&nbsp;<span style=\"text-align: justify;\">Фуриал Френдс</span>&nbsp;от Hasbro&nbsp;в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Белый щенок модные зверята FurReal Friends A9935 A9085 Hasbro купить в интернет магазине FurReal.ru','Купить белого щенка модные зверята FurReal Friends от Hasbro по самой низкой цене в интернет-магазине FurReal.ru!','щенок принцесса furreal friends модные зверята купить фуриал френдс интерактивная мягкая игрушка собачка pets with style princess белая','text','text',NULL),(15015,NULL,NULL,1498025993,1498025994,1498025993,NULL,500,'Y','Коала FurReal Friends \"Забавные зверята\"',17780,NULL,'koala-furreal-friends-zabavnyie-zveryata',NULL,'<p style=\"text-align: justify;\">Экзотическая зверушка коала FurReal Friends (Фуриал Френдс)&nbsp;входит в коллекцию замечательных &quot;Забавных зверят&quot; от Hasbro. Эта очаровательная игрушка наделена интересными звуковыми эффектами<a href=\"http://furreal.ru/catalog/12852-koala-furreal-friends-zabavnyie-zveryata\">,</a> а также способна взаимодействовать со специальным аксессуаром для кормления, который имеется в комплекте. Аксессуар представляет собой игрушечную пачку сока.</p>\r\n\r\n<p style=\"text-align: justify;\">Коалы нравятся многим детям, и это совсем неудивительно, ведь необычные большеглазые зверята очень симпатичны. Эта коала &quot;Фуриал Френдс&quot; по имени Sneezy Kiki или просто Кики &mdash; не исключение. У нее очень приятная на ощупь серая шерстка, большие и блестящие глазки коричневого цвета с длинными ресничками. Пушистые белые ушки так и хочется потрогать, а одно из них вдобавок украшено кокетливым зеленым бантиком. Коала изображена сидящей, а на ее шее имеется фирменный медальон FurReal Friends в виде синего сердечка.</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивная Коала FurReal Freinds способна издавать целую серию замечательных и забавных звуков. Ее характерной особенностью, отличающей игрушку от других питомцев, является умение чихать. Чихает игрушка презабавно &mdash; и не потому, что заболела, а просто от удовольствия. Ее приятно брать на ручки и кормить, используя пакетик сока из комплекта. На кормление игрушка реагирует приятным урчанием.</p>\r\n\r\n<p style=\"text-align: justify;\">Малышка-коала, как и другие &quot;Забавные зверята, имеет небольшой и компактный размер. Ребенок сможет взять своего необычного домашнего любимца с собой, чтобы продемонстрировать всем эту прелесть и ее необычные умения.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивную коалу FurReal Friends дешево в интернет-магазине&nbsp;FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Коала FurReal Friends забавные зверята B3002 A9084 Hasbro Lil Big Paws купить в интернет-магазине FurReal.ru','Купить интерактивную коалу FurReal Friends \"Забавные зверята\" от Hasbro по самой выгодной цене в интернет магазине FurReal.ru!','furreal friends забавные зверята коала интерактивная игрушка купить чихающая пушистые друзья sneezy kiki koala lil big paws фуриал френдс смешные зверушки ','text','text',NULL),(15016,NULL,NULL,1498025995,1498025996,1498025995,NULL,500,'Y','Обезьянка FurReal Friends \"Забавные зверята\"',17784,NULL,'obezyanka-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/I3-mf25HGLo\" width=\"360\"></iframe></p>\r\n\r\n<p>Интерактивная обезьянка FurReal Friends (Фуриал Френдс)&nbsp;входит в серию &quot;Забавные зверята&quot; от Hasbro. Зверюшка оснащена звуковыми эффектами и реагирует на кормление. Для того чтобы угостить питомца вкусняшкой, в комплекте имеется пластиковое мороженое в виде бананов на палочке. Игрушка сделана из очень приятных на ощупь текстильных материалов. Ее мордочка, ушки, передние лапки созданы из мягкого пластика.</p>\r\n\r\n<p>Этот веселый зверек Фуриал Френдс Lil Big Paws реагирует на нажатия. Она издает самые разные смешные и веселые звуки. Игрушку можно брать на ручки, представляя как хозяин или хозяйка успокаивают и баюкают мартышку. Она небольшого размера и легкая по весу, так что для ребенка не составит труда брать ее с собой.Шерстка у интерактивной обезьяны FurReal Friends коричневого цвета с бежевой вставкой на животике. На шее у игрушки имеется фирменный медальон с логотипом из той же серии.</p>\r\n\r\n<p>Внутри, под шкуркой, хорошо скрыт механизм, обеспечивающий движение передних лапок и звуковые эффекты. Он не мешает комфортной игре с питомцем. Реалистичный аксессуар-мороженое помогает ребенку активно взаимодействовать со зверушкой. Если поднести его к ротику мартышки, она будет издавать звуки, имитирующие кормление. Мартышка чем-то похожа на пупса, поэтому особенно будет интересна девочкам, которые любят игры в &quot;дочки-матери&quot;.</p>\r\n\r\n<p>Купить обезьянку FurReal Friends можно в качестве первого игрушечного питомца подобного рода в коллекции ребенка. Ведь у нее столько достоинств: простые, но эффектные движения и звуки, выгодная цена, прочность и практичность. И, конечно же, очаровательный внешний вид. Синие глаза с длинными ресничками очаровывают всех вокруг, так и хочется потрепать этого милого зверька за пухлые щечки, а его пузико &mdash; пощекотать.</p>\r\n\r\n<p>Купить интерактивную обезьянку забавные зверята&nbsp;FurReal Friends /&nbsp;Фуриал Френдс&nbsp;от Хасбро&nbsp;по низкой&nbsp;цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интерактивная обезьянка FurReal Friends забавные зверята B4990 A9084 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку обезьянку FurReal Friends \"Забавные зверята\" от Hasbro дешево в интернет магазине FurReal.ru с доставкой по всей России!','furreal friends забавные зверята обезьянка интерактивная игрушка купить обезьяна пушистые друзья giddy banana monkey lil big paws фуриал френдс смешные зверушки ','text','text',NULL),(15017,NULL,NULL,1498025998,1498025999,1498025998,NULL,500,'Y','Крокодильчик FurReal Friends \"Забавные зверята\"',17791,NULL,'krokodilchik-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/g-2yzzTphdM\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивный крокодил FurReal Friends (Фуриал Френдс)&nbsp;из серии &quot;Забавные зверята&quot; от Hasbro удивит кого угодно. Еще бы, часто ли вам доводилось видеть именно крокодила в качестве домашнего любимца? Да еще и такого хорошенького, с милыми глазками и пушистой на ощупь шкуркой! Крокодил по имени Snappy the Gator из серии Lil Big Paws &quot;Фуриал Френдс&quot; подружится с любым малышом. Он совершенно не кусается, разве что очень любит грызть свою игрушку-крабика, которая имеется в комплекте.</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивный крокодильчик &quot;Фуриал Френдс&quot; сделан из качественных материалов, покрыт приятным текстилем. Он красивого салатового оттенка, а пузико у зверька светло-желтое. Большая пасть изготовлена из резины, можно увидеть в ней мелкие белые зубки, которые тоже приятны на ощупь. А большие желтые глаза зверюшки так и светятся добротой! Крокодильчик изображен в сидячем положении с очень мило растопыренными передними лапками.</p>\r\n\r\n<p style=\"text-align: justify;\">Как и все другие питомцы из коллекции &quot;Забавные зверята / Пушистые друзья FurReal Friends&quot;, крокодильчик от Hasbro наделен своим уникальным умением. Он обожает, когда ему предлагают поиграть с аксессуаром, входящим в комплект. Он может открывать пасть и с удовольствием играть с крабиком, которого можно предложить питомцу в качестве лакомства или просто как игрушку. Крокодил издает множество веселых звуков, которые поднимают настроение всем окружающим.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного крокодильчика FurReal Friends &mdash; означает заполучить пожалуй самого экзотичного и необычного пушистого друга в свою компанию! Кстати, если имя Snappy не очень подойдет крокодилу, то вы сможете назвать его каким угодно прозвищем. А еще этот крокодильчик очень компактный, поэтому ребенок сможет без проблем брать такого питомца с собой, чтобы похвастать перед друзьями.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного крокодила&nbsp;FurReal Friends /&nbsp;Фуриал Френдс от Хасбро&nbsp;по самой дешевой цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интерактивный крокодил FurReal Friends Забавные зверята B4988 A9084 Hasbro Lil Big Paws купить в интернет-магазине','Купить интерактивного крокодила FurReal Friends \"Забавные зверята\" от Hasbro по самой выгодной цене вы можете в интернет-магазине FurReal.ru!','furreal friends забавные зверята крокодильчик интерактивная игрушка купить крокодил пушистые друзья snappy the gator lil big paws фуриал френдс смешные зверушки ','text','text',NULL),(15018,NULL,NULL,1498026004,1498026005,1498026004,NULL,500,'Y','Хаски FurReal Friends \"Забавные зверята\"',17798,NULL,'haski-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/uCGmEm3dwME\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Игрушка &quot;Хаски&quot; FurReal Friends&nbsp;(Фуриал Френдс), относящаяся к серии &quot;Забавные зверята&quot; от Hasbro &mdash; преданный друг, способный развлечь ребенка. О щенке породы хаски мечтают многие дети, ведь он такой хорошенький и похож на волчонка. Хаски &quot;Фурал Френдс&quot; - не просто мягкая игрушка. Она оснащена способностью весело выть, поднимая мордочку, а еще в комплекте с ней можно найти аксессуар для игры в кормление питомца, представленный в виде коктейля с трубочкой. Интерактивный щенок-волчонок DJ Howler понравится всем без исключения!</p>\r\n\r\n<p style=\"text-align: justify;\">Активность зверька очень легко провоцируется нажатием на скрытую кнопку, которая расположена на спинке щенка. У хаски FurReal Friends серо-белая шерстка, очень мягкая и приятная на ощупь. Острые ушки и средней длины хвостик только усиливают сходство с волчонком. Голубые глаза игрушки изготовлены из пластика со специальным эффектом отражения света, что делает мордашку щеночка особенно милой и выразительной.</p>\r\n\r\n<p style=\"text-align: justify;\">&quot;Хаски-голубые глазки&quot; с удовольствием продемонстрирует свой вокальный диапазон. Когда щенок весело воет на разные лады, он еще и запрокидывает голову в характерном движении. А если поднести коктейль ко рту игрушки, щеночек будет &quot;кушать&quot;, сопровождая это действие забавными звуками.</p>\r\n\r\n<p style=\"text-align: justify;\">Игрушка сделана очень качественно, она имеет небольшой размер. Для всей серии &quot;Забавные зверята FurReal Friends: Lil Big Paws&quot; от Hasbro характерно наличие уникальных способностей, доступных питомцам. Хаски &quot;Фуриал френдс&quot; может получить от своего хозяина или хозяйки любое имя, хотя производитель предлагает кличку DJ Howler. Раз этот щенок &mdash; диджей, то у него, должно быть, хороший вкус к музыке!</p>\r\n\r\n<p style=\"text-align: justify;\">Купить хаски&nbsp;FurReal Friends&nbsp;/ Фуриал Френдс от Hasbro по самой дешевой цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Хаски FurReal Friends Забавные зверята A9699 A9084 Hasbro Lil Big Paws купить в интернет-магазине FurReal.ru','Купить хаски FurReal Friends \"Забавные зверята\" от Hasbro дешево по самой никой цене в интернет магазине FurReal.ru!','furreal friends забавные зверята хаски интерактивная игрушка щенок волчонок dj howler lil big paws пушистые друзья фуриал френдс смешные зверушки ','text','text',NULL),(15019,NULL,NULL,1498026009,1498026009,1498026009,NULL,500,'Y','Щенок Фрэнки FurReal Friends \"Забавные зверята\"',17806,NULL,'schenok-frenki-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/NxUcbtASdd8\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Щенок&nbsp;Фрэнки из серии интерактивных питомцев &quot;Забавные зверята&quot; FurReal Friends&nbsp;(Фуриал Френдс)&nbsp;от Hasbro &mdash; просто очаровашка. У него серьезный и вместе с тем забавный внешний вид, серая пушистая шерстка и большие&nbsp;ушки. Неимоверно красивые бирюзовые глаза так и сияют на игрушечной мордашке. В тон к ним подобран стильный медальон на шее щеночка, на котором изображен фирменный логотип коллекции&nbsp;&quot;Фуриал Френдс&quot;.</p>\r\n\r\n<p style=\"text-align: justify;\">Как и другие &quot;Забавные зверята Фуриал Френдс Lil&#39; Big Paws&quot; от Hasbro, этот щеночек наделен особыми навыками. Он очень любит мороженое, и его заботливый хозяин или хозяйка, конечно же, не будет отказывать зверьку в удовольствии. В комплект вместе с мягким игрушечным псом FurReal Friends входит пластиковый конус с мороженым. Если нажать на щенка, он будет с забавными звуками выпрашивать сладкое лакомство. В свою очередь, если поднести мороженое к мордочке питомца, он очень обрадуется и будет изображать процесс поедания сладости, опять же сопровождая это веселыми звуками.</p>\r\n\r\n<p style=\"text-align: justify;\">Вся механическая &quot;начинка&quot; игрушки надежно скрывается под приятной на ощупь шерсткой. Блок с батарейками нисколько не помешает игре ребенка с интерактивным щенком Фрэнки FurReal Friends. Кстати, Frankie &mdash; это имя, данное собачке производителем, но владелец питомца, конечно же, сможет придумать для него любую другую кличку.</p>\r\n\r\n<p style=\"text-align: justify;\">Игрушка &quot;Интерактивный щенок-сладкоежка Фрэнки&quot; понравится и мальчикам, и девочкам от 4-х лет. Она небольшая по размеру, поэтому щеночка удобно брать с собой, и демонстрировать его умение выпрашивать лакомство на радость окружающим. Купить щенка Фрэнки из серии &quot;Забавные зверята&quot;&nbsp;FurReal Friends / Фуриал Френдс&nbsp;от Hasbro в интернет-магазине FurReal.ru вы можете по самой выгодной цене!</p>\r\n',2,9,NULL,NULL,'Щенок Фрэнки FurReal Friends забавные зверята B3003 A9084 Hasbro Lil Big Paws купить в интернет-магазине FurReal.ru','Купить щенка Фрэнки FurReal Friends \"Забавные зверята\" от Hasbro по самой низкой цене в интернет магазине FurReal.ru!','furreal friends забавные зверята щенок фрэнки интерактивная игрушка купить собака френки frankie treat time lil big paws пушистые друзья фуриал френдс смешные зверушки ','text','text',NULL),(15020,NULL,NULL,1498026012,1498026013,1498026012,NULL,500,'Y','Щенок Bouncy FurReal Friends \"Забавные зверята\"',17812,NULL,'schenok-bouncy-furreal-friends-zabavnyie-zveryata',NULL,'<p style=\"text-align: justify;\">Игрушка &quot;Щенок Bouncy&quot; из серии &quot;Забавные зверята&quot;&nbsp;FurReal Friends&nbsp;(Фуриал Френдс)&nbsp;от Hasbro станет верным другом и спутником ребенка. Мягкий игрушечный питомец может показывать интересный трюк, играя с ребенком в процессе активного взаимодействия. А еще щеночек Баунси &quot;Фуриал Френдс&quot; - настоящая очаровашка! Ее внешность никого не оставит равнодушным. Посудите сами: милые висячие ушки, украшенные бантиками, приоткрытый ротик с розовым язычком, умильные карие глазки и бирюзовый медальон на шее. Ну разве можно устоять перед ней?</p>\r\n\r\n<p style=\"text-align: justify;\">Интерактивная игрушка из серии &quot;Забавные зверята Фуриал Френдс&quot; Lil Big Paws - большая озорница. У нее есть розовый поводок, с которым она может играться. И делает она это как настоящая собака &mdash; если дать сложенный поводок ей в зубки, она вцепится в него и не захочет отдавать! Выглядит этот трюк интерактивного питомца чрезвычайно забавно. Щенок Bouncy играет, крепко хватая поводок и смешно дергая головой из стороны в сторону, а также издавая задорное ворчание. Щенок будто бы просит своего обладателя поиграть и погулять с ним еще!</p>\r\n\r\n<p style=\"text-align: justify;\">Шерстка щенка Боунси приятна на ощупь. Она сделана из качественного искусственного меха. Окрас собачки бежевый с белыми вставками. Все внутреннее устройство игрушки недоступно детям, так как хорошо спрятано внутри игрушки, включая блок с батарейками. При общении с таким интерактивным питомцем ребенок сможет фантазировать, что играет с настоящим щеночком. И собачка Bouncy не разочарует своего хозяина!</p>\r\n\r\n<p style=\"text-align: justify;\">Эту игрушку также характеризуют практичность и относительно небольшой размер, так что брать с собой щеночка на прогулку будет очень удобно. Вся серия игрушек &quot;Забавные зверята&quot; FurReal Friends&nbsp;от Hasbro наделена разными уникальными способностями. Игра с поводком, доступная щенку Bouncy, выглядит очень естественно и веселит окружающих.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивного&nbsp;щенка Bouncy&nbsp;&quot;Забавные зверята&quot;&nbsp;FurReal Friends /&nbsp;Фуриал Френдс&nbsp;от Hasbro дешево по самой низкой&nbsp;цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Щенок Bouncy FurReal Friends забавные зверята Hasbro Lil Big Paws купить в интернет-магазине FurReal.ru','Купить интерактивного щенка Bouncy FurReal Friends \"Забавные зверята\" от Hasbro по самой низкой цене в фирменном интернет магазине FurReal.ru!','furreal friends забавные зверята щенок bouncy интерактивная игрушка купить собака баунси бонси lil big paws пушистые друзья фуриал френдс смешные зверушки купить в интернет магазине','text','text',NULL),(15021,NULL,NULL,1498026015,1498026017,1498026015,NULL,500,'Y','Кошка Дейзи FurReal Friends \"Забавные зверята\"',17817,NULL,'koshka-deyzi-furreal-friends-zabavnyie-zveryata',NULL,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"203\" src=\"https://www.youtube.com/embed/uCGmEm3dwME\" width=\"360\"></iframe></p>\r\n\r\n<p style=\"text-align: justify;\">Кошка Дейзи из серии интерактивных игрушек &quot;Забавные зверята&quot;&nbsp;FurReal Friends (Фуриал Френдс) от Hasbro&nbsp;обожает играть в прятки. Маленький котенок Дейзи будет очень рад, если ребенок поиграет с ним, а после накормит и уложит спать. Хвостатый питомец имеет очень милый внешний вид и интересные интерактивные функции, которые делают общение с игрушкой веселым и увлекательным.</p>\r\n\r\n<p style=\"text-align: justify;\">В комплект с игрушкой &quot;Котенок Daisy FurReal Friends: Lil&#39; Big Paws&quot; входит специальная соска-бутылочка для кормления зверька. Выполнена она в виде смешной рыбки. Если ее поднести к ротику зверюшки, кошечка будет наклонять голову и издавать различные очаровательные звуки. Чтобы поиграть с котенком в прятки (игру &quot;Ку-ку!&quot;), нужно нажать малышу на животик. И тогда интерактивная кошка Дейзи Фуриал Френдс закрывает передними лапками глазки и издает очаровательное мяуканье!</p>\r\n\r\n<p style=\"text-align: justify;\">Кошка Дейзи FurReal Friends, как и все другие смешные зверушки из коллекции &quot;Забавные зверята&quot;, имеет свою уникальную фишку. В данном случае это способность играть в прятки с хозяином. Игрушка устойчиво стоит на задних лапках, что отличает ее от основной массы интерактивных котят, которые обычно находятся в сидячей или лежачей позе.</p>\r\n\r\n<p style=\"text-align: justify;\">У киски очень милая внешность: рыженькая приятная на ощупь шерстка, беленькие мордочка и животик. Возле ушка имеется очаровательный розовый бантик, а шею кошечки украшает эмблема в виде пластикового сердечка розового цвета. Зеленые глазки умильно глядят на хозяина, а еще у кошечки видно маленький высунутый язычок, что подчеркивает игривый нрав малышки. Играя в &quot;Ку-ку!&quot;, кошечка как будто немножко дразнится, пряча в лапках мордочку, а затем открывая ее.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивную игрушку кошку&nbsp;Дейзи&nbsp;&quot;Забавные зверята&quot;&nbsp;FurReal Friends / Фуриал Френдс от Hasbro по самой низкой&nbsp;цене в интернет-магазине FurReal.ru!</p>\r\n',2,9,NULL,NULL,'Кошка Дейзи FurReal Friends забавные зверята A9694 A9084 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку кошку Дейзи FurReal Friends забавные зверята от Hasbro по самой выгодной цене в фирменном интернет-магазине FurReal.ru!','furreal friends забавные зверята кошка дейзи интерактивная игрушка купить котенок кошечка daisy peek a boo lil big paws пушистые друзья фуриал френдс дэйзи смешные зверушки ','text','text',NULL),(15022,NULL,NULL,1498026027,1498026027,1498026027,NULL,500,'Y','Свинка FurReal Friends \"Поющие зверята\"',17826,NULL,'svinka-furreal-friends-poyuschie-zveryata',NULL,'<p style=\"text-align: justify;\">Свинка из серии &quot;Поющие зверята&quot;&nbsp;FurReal Friends&nbsp;(<span style=\"text-align: justify;\">Фуриал Френдс)&nbsp;</span>- милое интерактивное создание, которое удивит вас своими вокальными способностями. Да, этот очаровательный розовый поросенок умеет петь, да еще как! Чтобы активировать этот замечательный навык зверька, достаточно лишь нажать поросенку на спинку. У игрушки &quot;Поющая свинка FurReal Friends&quot; от Hasbro имеется специальная скрытая кнопка, которая находится под приятным на ощупь розовой тканью. При нажатии свинка не только начинает петь на разные лады, но и забавно приподнимает мордочку.</p>\r\n\r\n<p style=\"text-align: justify;\">Очаровательный внешний вид малыша даст всем вокруг повод для умиления. Вы только посмотрите на этот сладкий пятачок, крохотный хвостик, смешные ушки и большие и блестящие голубые глаза! Поросенок Фуриал Френдс небольшого размера и сделан очень прочно и качественно. Ребенок сможет с удовольствием брать его с собой. Самое интересное начнется, если собрать нескольких &quot;Поющих зверят Фуриал Френдс&quot; вместе, ведь они смогут устроить потрясающее хоровое пение! Причем, все зверята поют уникально, а вместе их пение звучит очень красиво.</p>\r\n\r\n<p style=\"text-align: justify;\">Электронные схемы и блок с батарейками нисколько не мешают игре с этими питомцами. &quot;Поющая свинка FurReal Friends&quot; с виду ничем не отличается от обычной мягкой игрушки, но ее уникальная способность забавно петь выделяет ее среди других. Внешний материал свинюшки очень приятен на ощупь, так что ребенку будет приятно холить, лелеять и держать на ручках такого прекрасного интерактивного друга.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить поросенка из серии &quot;Поющие зверята&quot; FurReal Friends /&nbsp;<span style=\"text-align: justify;\">Фуриал Френдс</span>&nbsp;от &quot;Хасбро&quot; дешево&nbsp;по низкой&nbsp;цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Свинка FurReal Friends поющие зверята B5115 B0698 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку свинку \"Поющие зверята\" FurReal Friends от Hasbro по самой низкой цене в фирменном интернет-магазине FurReal.ru!','furreal friends поющие зверята свинка интерактивная игрушка питомец поросенок свинюшка фуриал френдс luvimals купить в интернет магазине','text','text',NULL),(15023,NULL,NULL,1498026028,1498026029,1498026028,NULL,500,'Y','Лягушка FurReal Friends \"Поющие зверята\"',17828,NULL,'lyagushka-furreal-friends-poyuschie-zveryata',NULL,'<p style=\"text-align: justify;\">Лягушка из серии &quot;Поющие зверята&quot;&nbsp;FurReal Friends (Фуриал Френдс) покорит всех окружающих своим голосом. Нет, это не надоедливое кваканье настоящих лягушек, а прекрасные вокальные данные! Каждый сможет оценить голосовые способности интерактивной зверушки, стоит лишь нажать ему на спинку. И он покажет себя во всей красе!</p>\r\n\r\n<p style=\"text-align: justify;\">&quot;Поющие зверята&quot; FurReal Friends могут петь вместе, хором. Другие игрушки из этой коллекции продаются отдельно. Их голоса красиво и забавно звучат, когда со зверушками играют несколько хозяев. Для детей это приятное времяпровождение и отличная забава. Можно смело заявить, что этот очаровательный малыш - самый оригинальная среди остальных ! Еще бы, мало кто может похвастаться, что держит такое животное в качестве домашнего питомца, пусть даже и игрушечного.</p>\r\n\r\n<p style=\"text-align: justify;\">Несмотря на то, что настоящие жители болот не всегда кажутся милыми, этот плюшевый зверек &mdash; само очарование. Его блестящие и большие желтые глазки и приоткрытый ротик умиляют не только детей, но и взрослых. Лягушонок смешно стоит, растопырив лапки. Во время нажатия на скрытую под мягким на ощупь наполнителем кнопку, зверек приподнимает мордочку и издает звуки на различные лады.</p>\r\n\r\n<p style=\"text-align: justify;\">Еще можно заметить, что игрушка сделана очень качественно, ведь для ее изготовления применялись только лучшие материалы. Она очень проста в обращении, не занимает много места &mdash; ребенок с удовольствием возьмет милого дружка с собой. Механизм, при помощи которого происходят движение и звук, хорошо спрятан внутри, под приятной и гладкой тканью прекрасного бирюзового оттенка. А на шее у лягушонка есть фирменный медальон с эмблемой серии.</p>\r\n\r\n<p style=\"text-align: justify;\">Купить интерактивную лягушку&nbsp;FurReal Friends /&nbsp;<span style=\"text-align: justify;\">Фуриал Френдс&nbsp;</span>&quot;Поющие зверята&quot;&nbsp;от&nbsp;Hasbro по самой дешевой цене в интернет-магазине FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интеративная лягушка FurReal Friends поющие зверята B5115 B0698 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную лягушку \"Поющие зверята\" FurReal Friends от Hasbro по самой лучшей цене в интернет-магазине FurReal.ru!','furreal friends поющие зверята лягушка интерактивная игрушка питомец лягушонок фуриал френдс luvimals купить в интернет магазине','text','text',NULL),(15024,NULL,NULL,1498026029,1498026030,1498026029,NULL,500,'Y','Барашек FurReal Friends \"Поющие зверята\"',17830,NULL,'barashek-furreal-friends-poyuschie-zveryata',NULL,'<p style=\"text-align: justify;\">Интерактивная игрушка &quot;Барашек&quot;&nbsp;из серии &quot;Поющие зверята&quot; FurReal Friends (Фуриал Френдс) от Hasbro &mdash; прекрасное существо, которое вызывает восторг и умиление. Вы только взгляните на этого милого ягненка &mdash; ну разве он не прелестный? Абсолютно белая, мягкая и приятная на ощупь шкурка, забавные ушки, розовый носик сердечком и огромные, выразительные голубые глаза. Каждый захочет приютить такую игрушечную зверушку в своем доме!</p>\r\n\r\n<p style=\"text-align: justify;\">Отличительная особенность интерактивного &quot;Поющего барашка FurReal Friends&quot; - его голосок. Малыш умеет петь на разные лады, для чего нужно всего лишь нажать на его спинку. Внутри игрушки имеются хитрые механизмы. После нажатия ягненок FurReal Friends приподнимает мордочку и заливается пением. Такой пушистый вокалист точно станет звездой в любой детской!</p>\r\n\r\n<p style=\"text-align: justify;\">Если собрать нескольких &quot;Поющих зверушек Фуриал Френдс Luvimals&quot;, то можно устраивать групповое пение. Голоса зверушек хорошо сочетаются друг с другом, а игры с ними повеселят компанию детей. Каждый питомец из серии индивидуален, но ягненок &mdash; один из самых оригинальных, так как интерактивные игрушки, изображающие это животное, достаточно редки. Пушистая овечка&nbsp;может похвастаться не только кудрявой белой шерсткой и сладкой мордашкой, но и красивым медальоном-сердечком на шее.</p>\r\n\r\n<p style=\"text-align: justify;\">Среди других достоинств поющего барашка &mdash; компактный размер и практичность. Такую интерактивную игрушку FurReal Friends купить можно для самых маленьких, а еще он замечательно подойдет для тех, кто ищет незамысловатого, но эффектного пушистого друга-питомца, способного поднимать настроение. Купить интерактивного барашка&nbsp;FurReal Friends&nbsp;/ Фуриал Френдс от &quot;Хасбро&quot; дешево&nbsp;с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интерактивная игрушка барашек FurReal Friends поющие зверята C2175 C2173  Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку барашка \"Поющие зверята\" FurReal Friends от Hasbro по самой низкой цене в интернет-магазине FurReal.ru! ','furreal friends поющие зверята барашек интерактивная игрушка питомец ягненок овечка фуриал френдс luvimals купить в интернет магазине','text','text',NULL),(15025,NULL,NULL,1498026031,1498026033,1498026031,NULL,500,'Y','Утенок FurReal Friends \"Поющие зверята\"',17832,NULL,'utenok-furreal-friends-poyuschie-zveryata',NULL,'<p style=\"text-align: justify;\">Мягкий интерактивный питомец &quot;Поющий утенок&quot; FurReal Friends (Фуриал Френдс) &mdash; это воплощение позитива и очарования! Ярко-желтый, приятный на ощупь и забавный представитель серии &quot;Поющие зверята FurReal Friends&quot; - отличная игрушка, способная развеселить даже самую скучную компанию. Весь фокус в том, что утенок умеет крякать и, самое главное, забавно петь. Зверушка реагирует на нажатие, а благодаря размеру ее удобно брать в руки. После нажатия, уточка двигает головой и издает классные звуки на разные лады!</p>\r\n\r\n<p style=\"text-align: justify;\">Игрушки &quot;Поющие зверята&quot;&nbsp;FurReal Friends&nbsp;от Hasbro интересны тем, что они могут взаимодействовать друг с другом (другие питомцы продаются отдельно). Играя с друзьями-зверушками, дети смогут насладиться выступлением целого хора пушистиков. Все зверьки небольшого размера, их удобно брать с собой.</p>\r\n\r\n<p style=\"text-align: justify;\">Механизм, находящийся внутри игрушечного утенка FurReal Friends, совершенно не мешает игре. У уточки очаровательные круглые глазки с фиолетовой радужкой, маленький оранжевый клюв, а еще лапки, сделанные из пластика, на которых утенок может стоять. На шее можно увидеть фиолетовый медальон с эмблемой Фуриал Френдс.</p>\r\n\r\n<p style=\"text-align: justify;\">Стоит заметить, что утенок из серии &quot;Поющие зверята&quot; FurReal Freinds Luvimals&nbsp;- очень оригинальный выбор. Купить интерактивную игрушку &quot;Поющий утенок&quot; <span style=\"text-align: justify;\">FurReal Friends&nbsp;/&nbsp;Фуриал Френдс&nbsp;</span>от Хасбро в интернет-магазине&nbsp;FurReal.ru с доставкой по Москве, СПб и во все регионы России!</p>\r\n',2,9,NULL,NULL,'Интерактивная игрушка утенок FurReal Friends C2174 C2173 Hasbro купить в интернет-магазине FurReal.ru','Купить интерактивную игрушку утенка \"Поющие зверята\" FurReal Friends от Hasbro по самой лучшей цене в интернет-магазине FurReal.ru!','furreal friends поющие зверята утенок интерактивная игрушка питомец уточка цыпленок фуриал френдс luvimals купить в интернет магазине','text','text',NULL),(15026,NULL,NULL,1498026033,1498026034,1498026033,NULL,500,'Y','Щенок FurReal Friends \"Поющие зверята\"',17834,NULL,'schenok-furreal-friends-poyuschie-zveryata-15025',NULL,'<p style=\"text-align: justify;\">Интерактивная игрушка &quot;Поющий щенок&quot;&nbsp;FurReal Friends (Фуриал Френдс)&nbsp;от Hasbro &mdash;&nbsp;маленький милый пушистый дружок, который готов поселиться рядом с вами и развлекать ребенка своим очаровательным пением. Игрушка сделана из качественных материалов, внутри нее надежно скрыт механизм, который позволяет игрушке реагировать на действия ребенка.