INSERT INTO `cms_tree` VALUES (1,1,1,1416084922,1488316785,'Главная страница',NULL,NULL,'','<p>Они поражают нас своей бесконечной преданностью и бескорыстной любовью, необыкновенной красотой и грациозностью, веселым нравом и желанием всегда быть рядом с нами. Взамен они хотят совсем немного &ndash; порцию вкусного корма, наше внимание и ласку. Когда мы теряем их из-за болезней и старости, то вдруг понимаем, что ушел ДРУГ, а не просто кошка, собака или птичка.</p>\r\n\r\n<p>Мы создали этот магазин для своих единомышленников, то есть для тех, кто любит и заботится о своих питомцах, стремится сделать их жизнь разнообразней и комфортней. На нашем сайте вы найдете буквально все необходимое для того, чтобы ваши четвероногие или пернатые друзья ни в чем не нуждались.</p>\r\n',NULL,NULL,'1',0,NULL,0,NULL,'','N','Магазин игрушек SkeekS','','',1,'text','editor',NULL,301,'','',1),(9,1,1,1442576764,1488317526,'Каталог',NULL,NULL,'','','catalog',1,'1/9',1,'catalog',200,NULL,'','Y','','','',5,'text','text',NULL,301,'','',1),(17,1,1,1442577460,1478529199,'Контакты',NULL,NULL,'','<h1 style=\"font-family: Pfdindisplaypro-reg; margin: 0px 0px 20px; color: rgb(14, 14, 14); line-height: normal; font-size: 26px !important;\"><br />\r\n&nbsp;</h1>\r\n','contacts',1,'1/17',1,'contacts',500,NULL,'','Y','Контакты STROYKRAY.RU  +7(980)343-29-15 / г. Воронеж, ул Холмистая 26','Email: info@stroykray.ru','',2,'text','editor',NULL,301,'','contacts',1),(70,1,1,1456996581,1474822351,'Бренды',NULL,NULL,'','','brands',1,'1/70',1,'brands',300,NULL,'','Y','','','',2,'text','text',NULL,301,'','brands',1),(77,1,1,1457010249,1488319536,'Доставка и Оплата',NULL,NULL,'','','dostavka',1,'1/77',1,'dostavka',600,NULL,'','Y','','','',2,'text','editor',NULL,301,'','delivery',1),(1343,1,1,1460532540,1474822351,'Обратная связь',NULL,NULL,'','','feedback',1,'1/1343',1,'feedback',700,NULL,'','N','','','',2,'text','text',NULL,301,'','feedback',1),(1485,1,1,1471805701,1481721768,'Оптовые продажи',NULL,NULL,'','<p style=\"text-align: center;\"><strong><span style=\"color:#000000;\">Приглашаем к содрудничеству строительные и торговые &nbsp;организации!</span></strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p><font color=\"#000000\">Текст</font></p>\r\n','optovyie-prodaji',1,'1/1485',1,'optovyie-prodaji',900,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1486,1,1,1472740753,1481721787,'Поставщикам',NULL,NULL,'','<p style=\"text-align: center;\"><span style=\"color:#000000;\"><span style=\"font-size:14px;\"><strong>Всегда готовы к выгодному сотрудничеству!</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p>&nbsp; <span style=\"color:#000000;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Текст</span></p>\r\n','postavschikam',1,'1/1486',1,'postavschikam',1000,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1581,1,1,1488317169,1488317568,'Для мальчиков',17681,NULL,NULL,NULL,'dlya-malchikov',9,'1/9/1581',2,'catalog/dlya-malchikov',200,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1582,1,1,1488317175,1488317606,'Для девочек',17682,NULL,NULL,NULL,'dlya-devochek',9,'1/9/1582',2,'catalog/dlya-devochek',300,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1583,1,1,1488317201,1488317648,'Для спорта',17683,NULL,NULL,NULL,'dlya-sporta',9,'1/9/1583',2,'catalog/dlya-sporta',400,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1584,1,1,1488317215,1488317714,'Машинки',17685,NULL,NULL,NULL,'mashinki',1581,'1/9/1581/1584',3,'catalog/dlya-malchikov/mashinki',100,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1585,1,1,1488317221,1488317753,'Оружие',17686,NULL,NULL,NULL,'orujie',1581,'1/9/1581/1585',3,'catalog/dlya-malchikov/orujie',200,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1586,1,1,1488317526,1488317671,'Для малышей',17684,NULL,NULL,NULL,'dlya-malyishey',9,